import React from "react";
import {
  StyledContainer,
  PageTitle,
  PageLogo,
  InnerContainer,
} from "./../Components/Styles";

const Login = () => {
  return (
    <>
      <styledContainer>
        <InnerContainer>
          <PageLogo
            reSizeMode="cover"
            source={require("../../asset/chat.jpg")}
            alt="Studethandelr"
          />
        </InnerContainer>
      </styledContainer>
    </>
  );
};
export default Login;
